@profile
def func_3(array):
    m = 0
    num = 0
    set_array = set(array)
    for i in set_array:
        count = array.count(i)
        if count > m:
            m = count
            num = i
    return f'Чаще всего встречается число {num}, ' \
           f'оно появилось в массиве {m} раз(а)'


print("\nfunc_3:")
print(func_3(array_1))
print()


@profile
def func_3_NumPy(array):
    unique, counts = np.unique(np.array(array), return_counts=True)
    return f'Чаще всего встречается число {unique[0]}, ' \
           f'оно появилось в массиве {counts[0]} раз(а)'


print("\nfunc_3_NumPy:")
print(func_3_NumPy(array_1))
print()

